import React, { Component } from 'react';
import './App.scss';

import Winners from './Components/Winners';
import Users from './Components/Users';

import { BrowserRouter, Route } from 'react-router-dom';

// const Users =() => {
//   return (
//     <div>
//       <p>New Route</p>
//     </div>
//   )
// }

class App extends Component {
  render() {
    return (
      <BrowserRouter>
      <Route path="/users" component={Users} />

        <div className="c-app">
          <div className="c-app__header">
          <img className="c-app__logo" src={process.env.PUBLIC_URL+'/assets/images/logo_fusee.png'} alt="Logo Smile" />
          </div>
          <div className="c-app__main">
            <h1 className="c-app__title">BREAKFAST TIME !</h1>
            <h2 className="c-app__subTitle">And the winners are ...</h2> 
          <Winners /> 
          </div>
        </div>
      </BrowserRouter>
    );
  }
}


export default App;
